const ImageGridListStyle = {
	root: {
	    display: 'flex',
	    flexWrap: 'wrap',
	    justifyContent: 'space-around',
	    overflow: 'hidden',
	},
	gridList: {
		width: "100%",
		height: "auto"
	},
	tile: {
		padding: "200px"
	}
};

export default ImageGridListStyle;
